     },
     {
        imgsrc: pro3,
        title:"Drum Machine",
        text:"This online drum simulator project developed using ReactJS combines the flexibility and power of this popular JavaScript library with the expressive and rhythmic nature of drumming. ReactJS, known for its component-based architecture and dynamic user interfaces, provides the ideal framework to create a responsive and seamless drumming experience in a web application.",
        view:"https://codepen.io/omkarman-2003/pen/dygKBgK",
